import React, { useState, useEffect } from 'react';
import axios from 'axios';
import styles from './ManageServices.module.css';

const ManageServices = () => {
  const [services, setServices] = useState([]);
  const [newService, setNewService] = useState('');
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');
  const [success, setSuccess] = useState('');
  const [addingService, setAddingService] = useState(false);
  const [deletingService, setDeletingService] = useState(null);

  // Fetch services on component mount
  useEffect(() => {
    setLoading(true);
    axios.get('http://localhost:8080/api/services/data')
      .then(response => {
        setServices(response.data);
        setError('');
      })
      .catch(error => {
        setError('Failed to load services. Please try again later.');
        console.error('Fetch services error:', error);
      })
      .finally(() => {
        setLoading(false);
      });
  }, []);

  const handleAddService = () => {
    if (!newService.trim()) {
      setError('Service name cannot be empty');
      setSuccess('');
      return;
    }

    const serviceData = {
      serviceName: newService.trim()
    };

    setError('');
    setSuccess('');
    setAddingService(true);

    axios.post('http://localhost:8080/api/services/save', serviceData, {
      headers: {
        'Content-Type': 'application/json'
      }
    })
      .then(response => {
        setNewService('');
        setSuccess('Service added successfully');
        return axios.get('http://localhost:8080/api/services');
      })
      .then(response => {
        setServices(response.data);
      })
      .catch(error => {
        console.error('Add service error:', error);
        setError(
          error.response?.data?.message || 
          error.response?.data?.error || 
          error.message || 
          'Failed to add service'
        );
      })
      .finally(() => {
        setAddingService(false);
      });
  };

  const handleDeleteService = (serviceId) => {
    if (window.confirm('Are you sure you want to delete this service?')) {
      setDeletingService(serviceId);
      
      axios.delete(`http://localhost:8080/api/services/${serviceId}`)
        .then(() => {
          setSuccess('Service deleted successfully');
          return axios.get('http://localhost:8080/api/services');
        })
        .then(response => {
          setServices(response.data);
        })
        .catch(error => {
          console.error('Delete service error:', error);
          setError('Failed to delete service');
        })
        .finally(() => {
          setDeletingService(null);
        });
    }
  };

  if (loading) return <div className={styles.loading}>Loading services...</div>;

  return (
    <div className={styles.container}>
      <h2>Manage Services</h2>
      
      {error && <div className={styles.error}>{error}</div>}
      {success && <div className={styles.success}>{success}</div>}
      
      <div className={styles.addForm}>
        <input
          type="text"
          value={newService}
          onChange={(e) => setNewService(e.target.value)}
          placeholder="Enter service name"
          className={styles.input}
        />
        <button 
          onClick={handleAddService}
          disabled={addingService}
          className={styles.addButton}
        >
          {addingService ? 'Adding...' : 'Add Service'}
        </button>
      </div>
      
      <div className={styles.servicesList}>
        {services.length === 0 ? (
          <div className={styles.noServices}>No services found</div>
        ) : (
          services.map(service => (
            <div key={service.serviceId} className={styles.serviceItem}>
              <span className={styles.serviceName}>{service.serviceName}</span>
              <span className={styles.serviceStatus}>{service.status}</span>
              <button 
                onClick={() => handleDeleteService(service.serviceId)}
                disabled={deletingService === service.serviceId}
                className={styles.deleteBtn}
              >
                {deletingService === service.serviceId ? 'Deleting...' : 'Delete'}
              </button>
            </div>
          ))
        )}
      </div>
    </div>
  );
};

export default ManageServices;
